/* eslint-disable react/jsx-pascal-case */
import Create_Buttons from "./Create_Buttons";
import { useState } from "react";
import Board from "./Board";

const Body = () => {
  const [boards, setBoards] = useState([{name: "Board1"}, {name: "Board2"}]);
  return (
    <div id="content-body">
      <div id="Your-Boards">Your Boards</div>
      <div id="Boards-container">
        {boards.length > 0 ? (
          <div id="create-board-container">
            <Board name={boards.name}/>
          </div>
        ) : ('No Boards')}
        <Create_Buttons />
      </div>
    </div>
  );
};

export default Body;
